import builder from 'xmlbuilder';
import request from 'superagent';

const url = 'http://xmlpitest-ea.dhl.com/XMLShippingServlet';
const proxyurl = 'https://cors-anywhere.herokuapp.com/';

export const REQUEST_SEARCH_WAYBILL = 'REQUEST_SEARCH_WAYBILL';
export const RETURN_SEARCH_WAYBILL = 'RETURN_SEARCH_WAYBILL';
export const ERROR_SEARCH_WAYBILL = 'ERROR_SEARCH_WAYBILL';

function requestSearchWaybill(waybill) {
    return { type: REQUEST_SEARCH_WAYBILL, waybill };
}

function returnSearchWaybill(waybill, checkpoints) {
    return { type: RETURN_SEARCH_WAYBILL, waybill, checkpoints };
}

function errorSearchWaybill(error) {
    return { type: ERROR_SEARCH_WAYBILL, error };
}

export function searchWaybill(waybill) {
    return function (dispatch) {
        dispatch(requestSearchWaybill(waybill));

        var xml = builder.create('req:KnownTrackingRequest', { encoding: 'utf-8' })
            .att('xmlns:req', 'http://www.dhl.com')
            .att('xmlns:xsi', 'http://www.w3.org/2001/XMLSchema-instance')
            .att('xsi:schemaLocation', 'http://www.dhl.com TrackingRequestKnown.xsd')
            .ele('Request')
            .ele('ServiceHeader')
            .ele('SiteID', 'DServiceVal').up()
            .ele('Password', 'testServVal').up()
            .up()
            .up()
            .ele('LanguageCode', 'es').up()
            .ele('AWBNumber', waybill).up()
            .ele('LevelOfDetails', 'ALL_CHECK_POINTS').up()
            .ele('PiecesEnabled', 'S').up().end({ pretty: true });
        console.log(xml);

        request.post(proxyurl + url)
            .set('Content-Type', 'application/xml')
            .send(xml)
            .then(response => {
                var parser = new DOMParser();
                var dox = parser.parseFromString(response.text, 'application/xml');
                console.log(dox);
                var awbs = dox.getElementsByTagName('AWBInfo');
                var checkpoints = [];
                for (var i = 0; i < awbs.length; i++) {
                    const shipmentInfo = awbs[i].getElementsByTagName('ShipmentInfo')[0];
                    const originSA = shipmentInfo.getElementsByTagName('OriginServiceArea')[0];
                    const destinationSA = shipmentInfo.getElementsByTagName('DestinationServiceArea')[0];

                    checkpoints.push({
                        awbNumber: awbs[i].getElementsByTagName('AWBNumber')[0].childNodes[0].nodeValue,
                        shipmentDate: shipmentInfo.getElementsByTagName('ShipmentDate')[0].childNodes[0].nodeValue,
                        originAC: originSA.getElementsByTagName('ServiceAreaCode')[0].childNodes[0].nodeValue,
                        originDesc: originSA.getElementsByTagName('Description')[0].childNodes[0].nodeValue,
                        destinationAC: destinationSA.getElementsByTagName('ServiceAreaCode')[0].childNodes[0].nodeValue,
                        destinationDesc: destinationSA.getElementsByTagName('Description')[0].childNodes[0].nodeValue,
                        shipperName: shipmentInfo.getElementsByTagName('ShipperName')[0].childNodes[0].nodeValue,
                        shipperAN: shipmentInfo.getElementsByTagName('ShipperAccountNumber')[0].childNodes[0].nodeValue,
                        consigneeName: shipmentInfo.getElementsByTagName('ConsigneeName')[0].childNodes[0].nodeValue
                    });
                }
                console.log(checkpoints);
                dispatch(returnSearchWaybill(waybill, checkpoints));
            })
            .catch(error => {
                console.log(error);
                dispatch(errorSearchWaybill(error));
            });
    }
}

